function updatePopInFacebook(){$(document.getElementById('share_facebook')).find('div.facebook_loading').show();$(document.getElementById('share_facebook')).find('div#facebookPartOne').hide();frontvpg.fb.getLoginStatus(function(response){if(response.authResponse&&(response.status==="connected")){frontvpg.fb.api("/me/friendlists",{access_token:frontvpg.fb.getAccessToken()},function(response){if(response&&!response.error){var translatedTitle='';var facebookListContainer=$(document.getElementById('modal-share-fb')).find('select#facebook_lists');$.each(response.data,function(key,val){switch(val['name']){case'Close Friends':translatedTitle="Amis proches";break;case'Acquaintances':translatedTitle="Connaissances";break;case'Family':translatedTitle="Famille";break;default:translatedTitle=val['name'];break;}
facebookListContainer.append('<option value="'+val['id']+'">'+translatedTitle+'</option>');});frontvpg.openModal=true;window.location.href='#'+"modal-share-fb";getFriends();}});}});}
function getFriends(list){var friendsContainer=$('div#facebook_friends').empty();var requestFB='/me/friends';if(list){requestFB='/'+list+'/members';}
frontvpg.fb.api(requestFB,{access_token:frontvpg.fb.getAccessToken()},function(response){if(response&&!response.error){if(response.data.length){$.each(response.data,function(key,val){friendsContainer.append('<div class="cell_friend">'+'<div class="left_content"><img src="https://graph.facebook.com/'+val.id+'/picture" alt="'+val.name+'" /></div>'+'<div class="right_content"><h4>'+val.name+'</h4>'+'<input type="radio" value="'+val.id+'" name="checkedv" />'+'<label for="'+val.id+'">Inviter</label></div></div>');});}else{friendsContainer.append('<p id="nofriend">Vous n\'avez pas d\'amis sur cette liste</p>');}}});$(document.getElementById('facebookPartOne')).find('.facebookPartOneSubmit').on('click',function(event){if(!$(this).hasClass('disabled')){var facebookFriend=$('div#facebook_friends div.cell_friend input:checked').val();postToFeed(facebookFriend);}
return false;});$(document.getElementById('share_facebook')).find('div.facebook_loading').hide();$(document.getElementById('share_facebook')).find('div#facebookPartOne').show();}
function postToFeed(fid)
{$('body').removeClass('open-modal');frontvpg.openModal=false;window.location.href='#!';dataToShareFB.to=fid;frontvpg.fb.ui(dataToShareFB);}
$(document).ready(function(){frontvpg.hashModalUsed=["modal-share-fb"];$(document).on('change','select#facebook_lists',function(){if($(this).val()){getFriends($(this).val());}else{getFriends();}});$(document).on('change','div#facebook_friends div.cell_friend input',function(){if($('div#facebook_friends div.cell_friend input:checked').length){$('#modal-share-fb #facebookPartOne .facebookPartOneSubmit').removeClass('disabled');}});$(document.getElementById('social-network')).find('a.share').on('click',function(event){event.preventDefault();frontvpg.eventSocialNetwork(this);});$(document).on('cssmodal:show',function(event){$(window).unbind('hashchange',frontvpg.myHashChange);event.preventDefault();event.stopPropagation();var activeElement=CSSModal.activeElement;if(jQuery.inArray(activeElement.id,frontvpg.hashModalUsed)!=-1&&frontvpg.openModal){$(activeElement).addClass('open-modal');}else{window.location.hash=frontvpg.preventHashTag;}});});;
